(1, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=1&name=angel-x-demon-can-t-get-along&category_pathway=&Itemid=115', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=1&name=angel-x-demon-can-t-get-along&category_pathway=&Itemid=115', 'Angel X Demon, Can\'t get along!', '', '2021-11-15 02:48:04', 'bdeb8eee165175900baa22fdb5252834', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(2, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=2&name=relife&category_pathway=&Itemid=115', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=2&name=relife&category_pathway=&Itemid=115', 'Relife', '', '2021-11-15 02:51:27', '414e4418a9c2905da8481220045eb9ae', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(3, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=3&name=solo-leveling&category_pathway=&Itemid=115', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=3&name=solo-leveling&category_pathway=&Itemid=115', 'Solo Leveling', '', '2021-11-15 02:47:43', 'dfb36e491f4144eb674f514313b67f99', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(4, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=3&name=solo-leveling&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=3&name=solo-leveling&category_pathway=&Itemid=114', 'Solo Leveling', ' In a world where hunters, humans who possess magical abilities, must battle deadly monsters to protect the human race from certain annihilation, a notoriously weak hunter named Sung Jinwoo finds himself in a seemingly endless struggle for survival. One day, after narrowly surviving an overwhelmingly powerful double dungeon that nearly wipes out his entire party, a mysterious program called the System chooses him as its sole player and in turn, gives him the extremely rare ability to level up in strength, possibly beyond any known limits. Follow Jinwoo\'s journey as he fights against all kinds of enemies, both man and monster, to discover the secrets of the dungeons and the true source of his powers. ', '2021-11-15 05:58:20', '2c2bf1cef2a90ecf21305ebaecaeea76', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(5, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=2&name=relife&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=2&name=relife&category_pathway=&Itemid=114', 'Relife', ' The story revolves around 27-year-old Arata Kaizaki, a NEET who has been unemployed for several years; only working part-time at a convenience store. One day, a mysterious man named Ry Yoake offers him a job opportunity; but first, Kaizaki needs to become a tester for ReLife: a scientific experiment to make him appear 10 years younger and send him back to high school as a student. The experiment is supposed to provide a chance to experience youth once again and, in the process, fix whatever is wrong with the subject\'s life. ', '2021-11-15 05:58:13', '35b6ca88da4d58fee1b1dfd7ab6fdf46', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(6, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=1&name=angel-x-demon-can-t-get-along&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=1&name=angel-x-demon-can-t-get-along&category_pathway=&Itemid=114', 'Angel X Demon, Can\'t get along!', ' Demons and angels are two opposite races. As the times change, they are tired of fighting. In order to coexist peacefully, they decided to start a marriage plan! The plan has a one-year observation period. If the devil and angel still cannot get along well, the marriage will be cancelled. As a result, Jiacheng (devil) and Yu Shanshan (angel) were luckily selected by lottery as marriage partners, and started a happy cohabitation life with the destination of divorce~ ', '2021-11-16 07:56:12', '9532cb0997ec218fc90e38655e1c40f7', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(7, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=4&name=one-piece&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=4&name=one-piece&category_pathway=&Itemid=114', 'One Piece', ' The series focuses on Monkey D. Luffy, a young man who, inspired by his childhood idol and powerful pirate \"Red Haired\" Shanks, sets off on a journey from the East Blue Sea to find the titular treasure and proclaim himself the King of the Pirates. ', '2021-11-15 13:34:46', '638254179b5d7672a917c28b34892c07', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(8, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=5&name=silver-spoon&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=5&name=silver-spoon&category_pathway=&Itemid=114', 'Silver Spoon', ' The story is set in the fictional Ooezo Agricultural High School in Hokkaido, and depicts the daily life of Yuugo Hachiken, a high school student from Sapporo who enrolled at Ooezo Agricultural High School fleeing from the demands of his strict father. However, he soon learns that life on an agricultural school is not as easy as he initially believed. Unlike his new classmates, he has no intention of following an agricultural career after graduating, although he envies them for already having set goals for their lives and the pursuit of their dreams. ', '2021-11-15 13:41:59', '7456cb94e73a0b7cc2a1d95ff5cba9c6', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(9, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=6&name=horimiya&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=6&name=horimiya&category_pathway=&Itemid=114', 'Horimiya', ' Kyouko Hori is a popular high school girl, who, despite her ostentatious appearance, excels in academics, has a family-loving character and is a completely different person outside of school. In her workaholic parents\' absence, Hori acts as a parent for her little brother since she was young. ', '2021-11-15 13:51:42', 'ebf824db7c1abfae8bb82c503998da48', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, );
INSERT INTO `j4s28_finder_links` (`link_id`, `url`, `route`, `title`, `description`, `indexdate`, `md5sum`, `published`, `state`, `access`, `language`, `publish_start_date`, `publish_end_date`, `start_date`, `end_date`, `list_price`, `sale_price`, `type_id`, `object`) VALUES
(10, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=7&name=saint-young-men&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=7&name=saint-young-men&category_pathway=&Itemid=114', 'Saint Young Men', ' Saint Young Men follows the lives of Jesus Christ and Buddha, who live again in Japan as young men, roommates, and best friends. Jesus is often lazy, care-free, irresponsible, and impulsive. He frequently has to get \"permission\" from Buddha to do or buy things. ', '2021-11-15 13:56:26', 'd313c5174720aa8ec42716e0cc40f578', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(11, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=8&name=beastars&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=8&name=beastars&category_pathway=&Itemid=114', 'Beastars', ' The story takes place in a world of modern, civilized, anthropomorphic animals with a cultural divide between carnivores and herbivores. The series takes its name from the in-universe title of Beastar, an individual of great talent, service, and notoriety. ', '2021-11-15 13:59:57', 'a9d638f2a29e3e39654426664f0d8e0a', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(12, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=9&name=don-t-toy-with-me-miss-nagatoro&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=9&name=don-t-toy-with-me-miss-nagatoro&category_pathway=&Itemid=114', 'Don\'t Toy with Me, Miss Nagatoro', ' High schooler Hayase Nagatoro loves to spend her free time doing one thing, and that is to bully her Senpai. After Nagatoro and her friends stumble upon the aspiring artist\'s drawings, they find enjoyment in mercilessly bullying the timid Senpai. ', '2021-11-15 14:02:56', '40c09e7cc23dac1f8098c06f9a676e24', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(13, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=10&name=plastic-memories&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=10&name=plastic-memories&category_pathway=&Itemid=114', 'Plastic Memories', ' Plastic Memories takes place in a city in the near future, in which humans live alongside androids that look exactly like humans and have human emotion and memory. SAI Corp, the leading android production company, has introduced the Giftia, an advanced android model with the most human-like qualities of any model. However, there is a catch. The lifespan of a Giftia is determined beforehand, and a Giftia can only live for a maximum of 81,920 hours (roughly nine years and four months). If they pass their expiration date, it causes personality disintegration, memory loss, and outbreaks of violence; those who experience this are known as wanderers. Wanderers only act on instinct and can no longer recognize their owners. As a result, the Terminal Services are established with the duty of retrieving Giftias who are close to the end of their lifespans from their owners, and erasing the Giftias\' memories. To perform this job, the Terminal Service employees work in teams consisting of a human (called a \"spotter\") and a Giftia (called a \"marksman\"). The story follows the work and life of such a team in SAI Corp\'s Terminal Service One office, the human protagonist Tsukasa Mizugaki and a Giftia named Isla. Slowly, their relationship progresses, and as both slowly fall in love, Isla is revealed to be nearing the end of her own lifespan. ', '2021-11-15 14:05:50', 'd27f5cd88c32cb3142172fe6605cfc50', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(14, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=11&name=your-lie-in-april&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=11&name=your-lie-in-april&category_pathway=&Itemid=114', 'Your Lie in April', ' A piano prodigy who lost his ability to play after suffering a traumatic event in his childhood is forced back into the spotlight by an eccentric girl with a secret of her own. The story follows Arima Kousei, a skilled pianist. However, he hasn\'t played since he played for his mother who died a few years ago. ', '2021-11-15 14:08:34', '3a6ce8ff5cb8de1cbeea941d3c7a2d77', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(15, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=12&name=last-game&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=12&name=last-game&category_pathway=&Itemid=114', 'Last Game', ' The story mostly revolves around Naoto Yanagi, a rich, handsome, and popular boy who meets Mikoto Kujou, a \"gloomy\", poor and silent girl who, despite that, never failed to defeat Naoto at everything he\'s good at, whether it may be academics or sports. The series follows them from the time they meet in elementary school until their second year in college, where most of the series takes place. ', '2021-11-16 07:33:33', '59b4b1b6640cae855d531d363faca838', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(16, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=13&name=sword-art-online&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=13&name=sword-art-online&category_pathway=&Itemid=114', 'Sword Art Online', ' The story of the first season follows the adventures of Kazuto \"Kirito\" Kirigaya and Asuna Yuuki, two players who are trapped in the virtual world of \"Sword Art Online\" (SAO). They are tasked to clear all 100 Floors and defeat the final boss in order to be freed from the game. ', '2021-11-15 14:15:53', 'eef673aa89121c66a335ea347c2a1932', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, );
INSERT INTO `j4s28_finder_links` (`link_id`, `url`, `route`, `title`, `description`, `indexdate`, `md5sum`, `published`, `state`, `access`, `language`, `publish_start_date`, `publish_end_date`, `start_date`, `end_date`, `list_price`, `sale_price`, `type_id`, `object`) VALUES
(17, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=14&name=record-of-ragnarok-vol-1&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=14&name=record-of-ragnarok-vol-1&category_pathway=&Itemid=114', 'Record of Ragnarok, Vol. 1', ' Every 1000 years, the Gods\' Council assembles to decide the fate of humanity. After 7 million years of human history, the gods come to the decision that humans are irredeemable and must go extinct. However, the valkyrie Brunhilde proposes to give humanity one last chance to prove their worth and the gods agree to hold the battle of Ragnarok, a tournament with 13 notable humans from across history against 13 of the most powerful gods engaging in duels to the death. Humanity will be spared if their side achieves 7 victories in the competition. To even the odds, each human is granted the assistance of a valkyrie who transforms into a powerful weapon tailored for their user\'s combat style called \"Volund\", at the risk of losing her life if the user is killed. ', '2021-11-15 14:19:16', 'e4caca349d7dd3adb873ee3c99cc091b', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(18, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=15&name=berserk&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=15&name=berserk&category_pathway=&Itemid=114', 'Berserk', ' Set in a medieval Europe-inspired dark fantasy world, the story centers on the characters of Guts, a lone mercenary, and Griffith, the leader of a mercenary band called the \"Band of the Hawk\". Miura premiered a prototype of Berserk in 1988. The series began the following year in the Hakusensha\'s now-defunct magazine Monthly Animal House, which was replaced in 1992 by the semimonthly magazine Young Animal, where Berserk has continued its publication intermittently. Miura died of aortic dissection in May 2021. A posthumous chapter was published in the magazine in September 2021. ', '2021-11-15 14:22:50', '87f461a99f8050a74ad62f5b09715ce1', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(19, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=16&name=the-beginning-after-the-end&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=16&name=the-beginning-after-the-end&category_pathway=&Itemid=114', 'The Beginning After The End ', ' Beneath the glamorous exterior of a powerful king lurks the shell of a man, devoid of purpose and will. Reincarnated into a new world filled with magic and monsters, the king has a second chance to relive his life. Correcting the mistakes of his past will not be his only challenge, however. Underneath the peace and prosperity of the new world is an undercurrent threatening to destroy everything he has worked for, questioning his role and reason for being born again. ', '2021-11-15 14:25:09', 'bea81e94b0a89d9a7af193d0c653ba36', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(20, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=17&name=my-hero-academia&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=17&name=my-hero-academia&category_pathway=&Itemid=114', 'My Hero Academia', ' A superhero-loving boy without any powers is determined to enroll in a prestigious hero academy and learn what it really means to be a hero. In a world populated with superhumans, the superhero-loving Izuku Midoriya is without power. However, after the Quirkless dreamer Izuku inherits the powers of the world\'s best superhero, All Might, his hopes of becoming the top hero are now possible. Once enrolled in the high school for heroes, U.A., Izuku soon discovers being a hero is much more complicated than it appears. ', '2021-11-15 14:29:14', '24c9033a44ffb8a82f9b5565c8fc9541', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(21, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=18&name=attack-on-titan&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=18&name=attack-on-titan&category_pathway=&Itemid=114', 'Attack on Titan', ' It is set in a world where humanity lives inside cities surrounded by three enormous walls that protect them from the gigantic man-eating humanoids referred to as Titans; the story follows Eren Yeager, who vows to exterminate the Titans after a Titan brings about the destruction of his hometown and the death of his mother. ', '2021-11-15 14:31:15', '71ac9db095702b5bf8f29efea19717b1', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(22, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=19&name=jujutsu-kaisen&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=19&name=jujutsu-kaisen&category_pathway=&Itemid=114', 'Jujutsu Kaisen', ' The story follows high school student Yuji Itadori as he joins a secret organization of Jujutsu Sorcerers in order to kill a powerful Curse named Ryomen Sukuna, of whom Yuji becomes the host. ', '2021-11-15 14:34:20', '448416d5d8001a2efb5759e8d8f8daef', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, ),
(23, 'index.php?option=com_hikashop&ctrl=product&task=show&cid=20&name=spy--family&category_pathway=&Itemid=114', 'index.php?option=com_hikashop&ctrl=product&task=show&cid=20&name=spy--family&category_pathway=&Itemid=114', 'Spy  Family', ' The story follows a spy who has to \"build a family\" to execute a mission, not realizing that the girl he adopts as a daughter and the woman he agrees to be in a fake marriage with are a mind reader and an assassin, respectively. ', '2021-11-15 14:35:51', '82578cbd925c858e811a29b48ec906a2', 1, 1, 1, '*', NULL, NULL, NULL, NULL, 0, 0, 6, );
