(1, 0, 'Angel X Demon, Can\'t get along!', '<p>Demons and angels are two opposite races. As the times change, they are tired of fighting. In order to coexist peacefully, they decided to start a marriage plan! The plan has a one-year observation period. If the devil and angel still cannot get along well, the marriage will be cancelled. As a result, Jiacheng (devil) and Yu Shanshan (angel) were luckily selected by lottery as marriage partners, and started a happy cohabitation life with the destination of divorce~</p>', -1, 'm_romance_axd', 1, 121, 1636943864, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1637049372, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1637049351, 2, 0, '', 5, 1, '', 'angel-x-demon-can-t-get-along', '0.0000000', '0.0000000', '', 0, '', '599.00000', NULL, NULL, '', 'NewCondition'),
(2, 0, 'Relife', '<p>The story revolves around 27-year-old Arata Kaizaki, a<a title=\"NEET\" href=\"https://en.wikipedia.org/wiki/NEET\">NEET</a>who has been unemployed for several years; only working part-time at a convenience store. One day, a mysterious man named Ry Yoake offers him a job opportunity; but first, Kaizaki needs to become a tester for ReLife: a scientific experiment to make him appear 10 years younger and send him back to high school as a student. The experiment is supposed to provide a chance to experience youth once again and, in the process, fix whatever is wrong with the subject\'s life.</p>', -1, 'm_sliceoflife_relife', 1, 2, 1636944420, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636955893, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1636983746, 0, 0, '', 0, 0, '', 'relife', '0.0000000', '0.0000000', '', 0, '', '499.00000', NULL, NULL, '', 'NewCondition'),
(3, 0, 'Solo Leveling', '<p>In a world where hunters, humans who possess magical abilities, must battle deadly monsters to protect the human race from certain annihilation, a notoriously weak hunter named Sung Jinwoo finds himself in a seemingly endless struggle for survival. One day, after narrowly surviving an overwhelmingly powerful double dungeon that nearly wipes out his entire party, a mysterious program called the System chooses him as its sole player and in turn, gives him the extremely rare ability to level up in strength, possibly beyond any known limits. Follow Jinwoo\'s journey as he fights against all kinds of enemies, both man and monster, to discover the secrets of the dungeons and the true source of his powers.</p>', -1, 'm_action_sololeveling', 1, 14, 1636944463, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636955899, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1637044677, 0, 0, '', 0, 0, '', 'solo-leveling', '0.0000000', '0.0000000', '', 0, '', '699.00000', NULL, NULL, '', 'NewCondition'),
(4, 0, 'One Piece', '<p>The series focuses on Monkey D. Luffy, a young man who, inspired by his childhood idol and powerful pirate \"Red Haired\" Shanks, sets off on a journey from the East Blue Sea to find<b>the titular treasure</b>and proclaim himself the King of the Pirates.</p>', -1, 'm_shonen_OnePiece', 1, 2, 1636983285, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636983285, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1636986695, 0, 0, '', 0, 0, '', 'one-piece', '0.0000000', '0.0000000', '', 0, '', '599.00000', NULL, 'html', '', 'NewCondition'),
(5, 0, 'Silver Spoon', '<p>The story is set in the fictional Ooezo Agricultural High School in Hokkaido, and depicts the daily life of Yuugo Hachiken, a high school student from Sapporo who enrolled at Ooezo Agricultural High School fleeing from the demands of his strict father. However, he soon learns that life on an agricultural school is not as easy as he initially believed. Unlike his new classmates, he has no intention of following an agricultural career after graduating, although he envies them for already having set goals for their lives and the pursuit of their dreams.</p>', -1, 'm_sliceoflife_SilverSpoon', 1, 2, 1636983676, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636983719, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1636983750, 0, 0, '', 0, 0, '', 'silver-spoon', '0.0000000', '0.0000000', '', 0, '', '446.00000', NULL, 'html', '', 'NewCondition'),
(6, 0, 'Horimiya', '<p>Kyouko Hori is a popular high school girl, who, despite her ostentatious appearance, excels in academics, has a family-loving character and is a completely different person outside of school. In her workaholic parents\' absence, Hori acts as a<b>parent</b>for her little brother since she was young.</p>', -1, 'm_sliceoflife_Horimiya', 1, 0, 1636984302, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636984302, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 0, 0, 0, '', 0, 0, '', 'horimiya', '0.0000000', '0.0000000', '', 0, '', '899.00000', NULL, 'html', '', 'NewCondition'),
(7, 0, 'Saint Young Men', '<p>Saint Young Men follows<b>the lives of Jesus Christ and Buddha</b>, who live again in Japan as young men, roommates, and best friends. Jesus is often lazy, care-free, irresponsible, and impulsive. He frequently has to get \"permission\" from Buddha to do or buy things.</p>', -1, 'm_sliceoflife_SYM', 1, 0, 1636984586, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636984586, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 0, 0, 0, '', 0, 0, '', 'saint-young-men', '0.0000000', '0.0000000', '', 0, '', '777.00000', NULL, 'html', '', 'NewCondition'),
(8, 0, 'Beastars', '<p>The story takes place in a world of modern, civilized, anthropomorphic animals with a<b>cultural</b>divide between carnivores and herbivores. The series takes its name from the in-universe title of Beastar, an individual of great talent, service, and notoriety.</p>', -1, 'm_sliceoflife_beastars', 1, 0, 1636984797, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636984797, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 0, 0, 0, '', 0, 0, '', 'beastars', '0.0000000', '0.0000000', '', 0, '', '399.00000', NULL, 'html', '', 'NewCondition'),
(9, 0, 'Don\'t Toy with Me, Miss Nagatoro', '<p>High schooler Hayase Nagatoro loves to spend her free time doing one thing, and that is to bully her Senpai. After Nagatoro and her friends stumble upon the aspiring artist\'s drawings, they find enjoyment in mercilessly bullying the timid Senpai.</p>', -1, 'm_romance_nagatoro', 1, 9, 1636984975, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636984975, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1637047920, 0, 0, '', 0, 0, '', 'don-t-toy-with-me-miss-nagatoro', '0.0000000', '0.0000000', '', 0, '', '899.00000', NULL, 'html', '', 'NewCondition'),
(10, 0, 'Plastic Memories', '<p><i>Plastic Memories</i>takes place in a city in the near future, in which humans live alongside<a title=\"Android (robot)\" href=\"https://en.wikipedia.org/wiki/Android_(robot)\">androids</a>that look exactly like humans and have human emotion and memory. SAI Corp, the leading android production company, has introduced the Giftia, an advanced android model with the most human-like qualities of any model. However, there is a catch. The lifespan of a Giftia is determined beforehand, and a Giftia can only live for a maximum of 81,920 hours (roughly nine years and four months). If they pass their expiration date, it causes personality disintegration, memory loss, and outbreaks of violence; those who experience this are known as wanderers. Wanderers only act on instinct and can no longer recognize their owners. As a result, the Terminal Services are established with the duty of retrieving Giftias who are close to the end of their lifespans from their owners, and erasing the Giftias\' memories. To perform this job, the Terminal Service employees work in teams consisting of a human (called a \"spotter\") and a Giftia (called a \"marksman\"). The story follows the work and life of such a team in SAI Corp\'s Terminal Service One office, the human protagonist Tsukasa Mizugaki and a Giftia named Isla. Slowly, their relationship progresses, and as both slowly fall in love, Isla is revealed to be nearing the end of her own lifespan.</p>', -1, 'm_romance_pm', 1, 1, 1636985150, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636985150, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1637047921, 0, 0, '', 0, 0, '', 'plastic-memories', '0.0000000', '0.0000000', '', 0, '', '999.00000', NULL, 'html', '', 'NewCondition'),
(11, 0, 'Your Lie in April', '<p><b>A piano prodigy who lost his ability to play after suffering a traumatic event in his childhood is forced back into the spotlight by an eccentric girl with a secret of her own</b>. The story follows Arima Kousei, a skilled pianist. However, he hasn\'t played since he played for his mother who died a few years ago.</p>', -1, 'm_romance_ylip', 1, 5, 1636985314, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636985314, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1637047963, 0, 0, '', 0, 0, '', 'your-lie-in-april', '0.0000000', '0.0000000', '', 0, '', '799.00000', NULL, 'html', '', 'NewCondition'),
(12, 0, 'Last Game', '<p>The story mostly revolves around <a title=\"Naoto Yanagi\" href=\"https://lastgame.fandom.com/wiki/Naoto_Yanagi\">Naoto Yanagi</a>, a rich, handsome, and popular boy who meets <a title=\"Mikoto Kujou\" href=\"https://lastgame.fandom.com/wiki/Mikoto_Kujou\">Mikoto Kujou</a>, a \"gloomy\", poor and silent girl who, despite that, never failed to defeat Naoto at everything he\'s good at, whether it may be academics or sports. The series follows them from the time they meet in elementary school until their second year in college, where most of the series takes place.</p>', -1, 'm_romance_lg', 1, 9, 1636985600, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1637048013, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1637049276, 0, 0, '', 0, 0, '', 'last-game', '0.0000000', '0.0000000', '', 0, '', '499.00000', NULL, 'html', '', 'NewCondition'),
(13, 0, 'Sword Art Online', '<p>The story of the first season follows the adventures of<b>Kazuto \"Kirito\" Kirigaya and Asuna Yuuki</b>, two players who are trapped in the virtual world of \"Sword Art Online\" (SAO). They are tasked to clear all 100 Floors and defeat the final boss in order to be freed from the game.</p>', -1, 'm_action_sao', 1, 5, 1636985753, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636985753, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1637047566, 0, 0, '', 0, 0, '', 'sword-art-online', '0.0000000', '0.0000000', '', 0, '', '899.00000', NULL, 'html', '', 'NewCondition'),
(14, 0, 'Record of Ragnarok, Vol. 1', '<p>Every 1000 years, the Gods\' Council assembles to decide the fate of humanity. After 7 million years of human history, the gods come to the decision that humans are irredeemable and must go extinct. However, the valkyrie Brunhilde proposes to give humanity one last chance to prove their worth and the gods agree to hold the battle of Ragnarok, a tournament with 13 notable humans from across history against 13 of the most powerful gods engaging in duels to the death. Humanity will be spared if their side achieves 7 victories in the competition. To even the odds, each human is granted the assistance of a valkyrie who transforms into a powerful weapon tailored for their user\'s combat style called \"Volund\", at the risk of losing her life if the user is killed.</p>', -1, 'm_action_rorv1', 1, 2, 1636985956, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636985956, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1636986327, 0, 0, '', 0, 0, '', 'record-of-ragnarok-vol-1', '0.0000000', '0.0000000', '', 0, '', '666.00000', NULL, 'html', '', 'NewCondition'),
(15, 0, 'Berserk', '<p>Set in a<a title=\"Middle Ages\" href=\"https://en.wikipedia.org/wiki/Middle_Ages\">medieval Europe</a>-inspired<a title=\"Dark fantasy\" href=\"https://en.wikipedia.org/wiki/Dark_fantasy\">dark fantasy</a>world, the story centers on the characters of<a class=\"mw-redirect\" title=\"Guts (Berserk)\" href=\"https://en.wikipedia.org/wiki/Guts_(Berserk)\">Guts</a>, a lone<a title=\"Mercenary\" href=\"https://en.wikipedia.org/wiki/Mercenary\">mercenary</a>, and<a class=\"mw-redirect\" title=\"Griffith (Berserk)\" href=\"https://en.wikipedia.org/wiki/Griffith_(Berserk)\">Griffith</a>, the leader of a mercenary band called the \"Band of the Hawk\". Miura premiered a prototype of<i>Berserk</i>in 1988. The series began the following year in the<a title=\"Hakusensha\" href=\"https://en.wikipedia.org/wiki/Hakusensha\">Hakusensha</a>\'s now-defunct magazine<i>Monthly Animal House</i>, which was replaced in 1992 by the semimonthly magazine<i><a title=\"Young Animal (magazine)\" href=\"https://en.wikipedia.org/wiki/Young_Animal_(magazine)\">Young Animal</a></i>, where<i>Berserk</i>has continued its publication intermittently. Miura died of<a title=\"Aortic dissection\" href=\"https://en.wikipedia.org/wiki/Aortic_dissection\">aortic dissection</a>in May 2021. A posthumous chapter was published in the magazine in September 2021.</p>', -1, 'm_action_berserk', 1, 0, 1636986170, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636986170, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 0, 0, 0, '', 0, 0, '', 'berserk', '0.0000000', '0.0000000', '', 0, '', '676.00000', NULL, 'html', '', 'NewCondition'),
(16, 0, 'The Beginning After The End ', '<p>Beneath the glamorous exterior of a powerful king lurks the shell of a man, devoid of purpose and will. Reincarnated into a new world filled with magic and monsters, the king has a second chance to relive his life. Correcting the mistakes of his past will not be his only challenge, however. Underneath the peace and prosperity of the new world is an undercurrent threatening to destroy everything he has worked for, questioning his role and reason for being born again.</p>', -1, 'm_action_tbate', 1, 2, 1636986309, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636986309, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1637044663, 0, 0, '', 0, 0, '', 'the-beginning-after-the-end', '0.0000000', '0.0000000', '', 0, '', '699.00000', NULL, 'html', '', 'NewCondition'),
(17, 0, 'My Hero Academia', '<p>A superhero-loving boy without any powers is determined to enroll in a prestigious hero academy and learn what it really means to be a hero.<br /><br />In a world populated with superhumans, the superhero-loving Izuku Midoriya is without power. However, after the Quirkless dreamer Izuku inherits the powers of the world\'s best superhero, All Might, his hopes of becoming the top hero are now possible. Once enrolled in the high school for heroes, U.A., Izuku soon discovers being a hero is much more complicated than it appears.</p>', -1, 'm_shonen_mha', 1, 0, 1636986554, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636986554, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 0, 0, 0, '', 0, 0, '', 'my-hero-academia', '0.0000000', '0.0000000', '', 0, '', '681.00000', NULL, 'html', '', 'NewCondition'),
(18, 0, 'Attack on Titan', '<p>It is set in a world where humanity lives inside cities surrounded by three enormous walls that protect them from the gigantic man-eating humanoids referred to as Titans; the story follows<a title=\"Eren Yeager\" href=\"https://en.wikipedia.org/wiki/Eren_Yeager\">Eren Yeager</a>, who vows to exterminate the Titans after a Titan brings about the destruction of his hometown and the death of his mother.</p>', -1, 'm_shonen_aot', 1, 2, 1636986675, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636986675, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1636986686, 0, 0, '', 0, 0, '', 'attack-on-titan', '0.0000000', '0.0000000', '', 0, '', '777.00000', NULL, 'html', '', 'NewCondition'),
(19, 0, 'Jujutsu Kaisen', '<p>The story follows<b>high school student Yuji Itadori</b>as he joins a secret organization of Jujutsu Sorcerers in order to kill a powerful Curse named Ryomen Sukuna, of whom Yuji becomes the host.</p>', -1, 'm_shonen_jjk', 1, 0, 1636986860, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636986860, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 0, 0, 0, '', 0, 0, '', 'jujutsu-kaisen', '0.0000000', '0.0000000', '', 0, '', '522.00000', NULL, 'html', '', 'NewCondition'),
(20, 0, 'Spy  Family', '<p>The story follows a<b>spy who has to \"build a family\" to execute a mission</b>, not realizing that the girl he adopts as a daughter and the woman he agrees to be in a fake marriage with are a mind reader and an assassin, respectively.</p>', -1, 'm_shonen_sxf', 1, 0, 1636986951, 0, 0, 0, 0, 'main', 0, 0, '', '0.000', '', 'kg', 1636986951, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 0, 0, 0, '', 0, 0, '', 'spy--family', '0.0000000', '0.0000000', '', 0, '', '511.00000', NULL, 'html', '', 'NewCondition');
